import {
  Form,
  Select,
  InputNumber,
  DatePicker,
  Switch,
  Slider,
  Button,
} from "antd";
const FormItem = Form.Item;

function setDataProfile() {
  return (
    <FormItem>
      <div>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
          }}
        >
          <div
            style={{
              display: "flex",
              justifyContent: "center",
            }}
          >
            <h1 style={{fontSize:"42px"}}>โปรดเลือกวิธีการระบุตัวตน</h1>
          </div>
          <div
            style={{
              flexDirection: "row",
              display: "flex",
              width: "100%",
            }}
          >
            <div
              style={{
                background: "orange",
                display: "flex",
                flexBasis: "auto",
                width: "100%",
                justifyContent: "center",
                alignItems: "center",
                margin: "10px",
                flexDirection: "column",
              }}
            >
              <box
                style={{
                  background: "white",
                  width: "100%",
                  border: "1px solid black",
                  padding: "10px",
                  background: "#FFFFFF0A 0% 0% no-repeat padding-box",
                  borderRadius: "47px"
                }}
              >
                  A
              </box>

              <h3 style={{fontSize:"22px"}}>กำหนดเอง</h3>
            </div>

            <div
              style={{
                background: "orange",
                display: "flex",
                flexBasis: "auto",
                width: "100%",
                justifyContent: "center",
                alignItems: "center",
                margin: "10px",
                flexDirection: "column",
              }}
            >
              <box
                style={{
                  background: "white",
                  width: "100%",
                  border: "1px solid black",
                  padding: "10px",
                  background: "#FFFFFF0A 0% 0% no-repeat padding-box",
                  borderRadius: "47px"
                }}
              >
                B
              </box>
              <h3 style={{fontSize:"22px"}}>ระบุตัวตนด้วยใบหน้า</h3>
            </div>
          </div>
        </div>
      </div>
    </FormItem>
  );
}

export default setDataProfile;
